import React from 'react'

export const ObjetosLiterales = () => {

    interface Persona { 
        nombreCompleto: string, 
        edad: number, 
        direccion: { 
            pais: string, 
            estado: string,  
            ciudad: string, 
            calle: string, 
            numero: number 
        } 
    }
    
  return (
    <div>
        <h3>Objetos Literales</h3>
        <code>
            <pre>
                {JSON.stringify(persona, null, 2)}
            </pre>
        </code>
    </div>
  )
}
